    return( 
    <option key={"filter-options"+filter+index} value={filter}>
       {filter}
    </option>
    );
  });
  return (
    <button className="filter-option-button" onClick={onClick} value={selected}>{}
    </button>

  );
};

export default ButtonOptions;
